(function(angular,undefined){"use strict";var djngUrls=angular.module("ng.django.urls",[]);djngUrls.provider("djangoUrl",function djangoUrlProvider(){var reverseUrl="/angular/reverse/";this.setReverseUrl=function(url){reverseUrl=url};this.$get=function(){return new djangoUrl(reverseUrl)}});var djangoUrl=function(reverseUrl){function forEachSorted(obj,iterator,context){var keys=sortedKeys(obj);for(var i=0;i<keys.length;i++){iterator.call(context,obj[keys[i]],keys[i])}return keys}function sortedKeys(obj){var keys=[];for(var key in obj){if(obj.hasOwnProperty(key)){keys.push(key)}}return keys.sort()}function buildUrl(url,params){if(!params)return url;var parts=[];forEachSorted(params,function(value,key){if(value===null||value===undefined)return;if(angular.isObject(value)){value=angular.toJson(value)}parts.push(encodeURIComponent(key)+"="+encodeURIComponent(value))});return url+(url.indexOf("?")===-1?"?":"&")+parts.join("&")}this.reverse=function(url_name,args_or_kwargs){var url=buildUrl(reverseUrl,{djng_url_name:url_name});if(Array.isArray(args_or_kwargs)){forEachSorted(args_or_kwargs,function(value){url=buildUrl(url,{djng_url_args:value})});return url}var params={};forEachSorted(args_or_kwargs,function(value,key){params["djng_url_kwarg_"+key]=value});if(angular.equals(params,{})){return url}return buildUrl(url,params)}}})(window.angular);